window.bookSummaryJSON = "<p><b>Yrlissa Blackmist has been a high-ranking member of the Broken Blade Assassin's Guild for longer than most family lines have existed.</b></p> <p>Such a long life of killing has left plenty of dangerous enemies in its wake. An ancient witch coven, a jealous assassin, and even a demon lord all have old scores to settle.</p> <p>With one last contract to fulfill, Yrlissa hopes to be free from her past and her guild forever so she can disappear with her husband and young daughter. But the past doesn't forget so easily, and neither will a betrayed guild of magical assassins. Yrlissa's only concern is to keep her new family safe, but with enemies closing in on all sides, will they become a distraction she cannot afford?</p>"; 
